import Contactme from "../components/Contactme";
import ErrorBoundary from "../components/ErrorBoundary";
import About from "./About";
import Portfolio from "./Portfolio";

//document.title = "Home Page | Mohsinur Rahman";
const Home = () => {
    return (
        <>
            <ErrorBoundary>
                <About />
            </ErrorBoundary>

            <ErrorBoundary>
            <Portfolio />
            </ErrorBoundary>

            <ErrorBoundary>
            <Contactme />
            </ErrorBoundary>
        </>
    );
};
  
export default Home;
